import Card from "react-bootstrap/Card";
import Container from "react-bootstrap/esm/Container";
import { useOutletContext } from "react-router-dom";

export default function Profile() {
  const [user, dispatchUser] = useOutletContext();

  return (
    <Container>
      <Card>
        <Card.Header>
          <h1>Profile</h1>
        </Card.Header>
        <Card.Img
          variant="top"
          src="https://avatars.dicebear.com/api/male/test.svg"
        />
        <Card.Body>
          <Card.Title>
            {user.firstName + " " + currUser.lastName}
          </Card.Title>
          <Card.Subtitle className="mb-2 text-muted">
            {currUser.email}
          </Card.Subtitle>
          <hr />
          <Card.Text>Joined: {currUser.joinedDate}</Card.Text>
        </Card.Body>
      </Card>
    </Container>
  );
}
